if mibBuilder.loadTexts: dot11OperationalRateSet.setDescription('This attribute shall specify the set of data rates at which the station may transmit data. Each octet contains a value representing a rate. Each rate shall be within the range from 2 to 127, corresponding to data rates in increments of 500 kb/s from 1 Mb/s to 63.5 Mb/s, and shall be supported (as indicated in the supported rates table) for receiving data. This value is reported in transmitted Beacon, Probe Request, Probe Response, Association Request, Association Response, Reassociation Request, and Reassociation Response frames, and is used to determine whether a BSS with which the station desires to synchronize is suitable. It is also used when starting a BSS, as specified in 10.3. This atribute also indicate the Basic Rate of the AP, rate that is used as transmit rate of 802.11 management and control packet. If 22Mbps is as basic rate, the bit 7(MSB) should be set(i.e. 0xAC, instead of 0x2C). Valid basic rate are (2-1)Mbps, (11-5.5-2-1)Mbps, (22-11-5.5-2-1)Mbps. example: (2-1)Mbps : 0x2C160B8482 (11-5.5-2-1)Mbps : 0x2C968B8482 (22-11-5.5-2-1)Mbps : 0xAC968B8482')
